import React from 'react'


class ShopMap extends React.Component {

	render() {

		let map;
		/*
		function initMap() {
			map = new google.maps.Map(document.getElementById('map'), {
				center: {lat: -34.397, lng: 150.644},
				zoom: 8
			});
		}
		*/
		map = 'yoyoyo';

		return (
			<div>
				<script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCt95qTXK2VBIGWxB8CiCWe8eBV475edOg&callback=initMap" async defer></script>
				<div id="map" style={{ height: '100%' }}></div>
				<div>{map}</div>
			</div>
		)
	}
}

export default ShopMap
